
create table photo (
          img_no number,
          r_name varchar2(30) not null,
          location varchar2(150) not null,
          img_name varchar2(3000) not null,
          
          constraint pk_photo_no primary key(img_no),
          constraint fk_photo_rname foreign key (r_name) references restaurant(r_name) on delete cascade
);

create sequence seq_photo_no;

